import React from 'react'


function Animal(props) {
  return (
    <div className='animal'>
        <img src={props.src} style={{
            'height':'20vh','width':'17vw'
        }}></img><br></br>
        Name: ABC<br></br>
        Age: X years<br></br>
        Size: large/medium/small<br></br>
        Sex: M/F<br></br>
        <button>View profile</button>
    </div>
  )
}

export default Animal
